const parameter =   {
                      particles: {
                                number: {
                                        value: 30,
                                        density: {
                                                enable: true,
                                                value_area: 800
                                                  }
                                        }  
                                  }
                    }

class App extends Component {
  constructor() {
    super();
    this.state = {
      input: '',
    }
  }

  onInputChange = (event) => 
  {
    console.log(event.target.value);
  }

  render(){
  return (
    <div className="App">
     <Particles className='particles' 
                params={parameter} />
     <Navigation />
     <Logo />
     <Rank />
     <ImageLinkForm onInputChange={this.onInputChange}/>
{/*     <FaceRecognition />
*/} 
     </div>
  );
}
}

export default App;
